                <a>{props.text}</a>
            </Link>
        </div>
        <style jsx>{`
            .container {
                border: solid 2px gold;
                height: 150px;
                width: 268px;
                display: flex;
                justify-content: center;
                align-items: center;
                background-color: gray;
                margin: 50px
            }
            a {
                color: black;
            }
        `}</style>
        </>
    )
}

export default Button
